package neet150;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;

public class Neet2 {
    static class Solution {
        public boolean isAnagram(String s, String t) {
            if(s.length() != t.length()){
                return false;
            }
            int first = 0;
            int second = 0;
            Map<Integer, Integer> frequency1 = new HashMap<>();
            Map<Integer, Integer> frequency2 = new HashMap<>();
            for(int i = 0; i<s.length();i++){
                int currentVal = s.charAt(i) - 61;
                if(frequency1.containsKey(currentVal))
                    frequency1.put(currentVal, frequency1.get(currentVal)+1);
                else
                    frequency1.put(currentVal, 1);
                int currentVal2 = t.charAt(i) - 61;
                if(frequency2.containsKey(currentVal2))
                    frequency2.put(currentVal2, frequency2.get(currentVal2)+1);
                else
                    frequency2.put(currentVal2, 1);
            }
            for (Map.Entry<Integer, Integer> entry : frequency1.entrySet()) {
                Integer key = entry.getKey();
                Integer value = entry.getValue();
                if (frequency2.containsKey(key)) {
                    //Check in chatgpt pointer
                    if (!(value.equals(frequency2.get(key)))) {
                        return false;
                    }
                } else {
                    return false;
                }
            }
            return true;
        }
    }


    public static void main(String[] args) {
        long startTime = System.currentTimeMillis();
        Solution solution = new Solution();
        //Solution2 solution = new Solution2();
        System.out.println("solution = " + solution.isAnagram("",
                ""));

        // Record the end time
        long endTime = System.currentTimeMillis();

        // Calculate elapsed time
        long elapsedTime = endTime - startTime;
        System.out.println("Execution time in milliseconds: " + elapsedTime);
    }


    static class Solution2 {
        public boolean isAnagram(String s, String t) {
            if (s.length() != t.length()) {
                return false;
            }

            int[] count = new int[26];
            for (int i = 0; i < s.length(); i++) {
                count[s.charAt(i) - 'a']++;
                count[t.charAt(i) - 'a']--;
            }

            for (int val : count) {
                if (val != 0) {
                    return false;
                }
            }
            return true;
        }
    }

}
